import React from 'react';
import { BrowserRouter, Route, Switch, Link } from "react-router-dom";

import Sidebar from './views/components/sidebar';
import Navbar from './views/components/navbar';
import Footer from './views/components/footer';

import Dashboard from './views/dashboard';
import Categories from './views/categories';
import SubCategories from './views/subcategories';
import Advisors from './views/advisors';
import Blogs from './views/blogs';
import Users from './views/users';
import PaymentMethod from './views/paymentmethod';
import Account from './views/account';
import Auth from './views/components/auth';
// import Streamer from './views/streamer';

function App() {

  const user = JSON.parse(localStorage.getItem('profile'))
  
  return (
    <div>
      <BrowserRouter>
          
          <Sidebar />            
            <div className="main-content" id="panel">
              <Navbar />

              <Switch>
                <Route path = "/" exact component = {Dashboard} />
                {user?.result?.userRole === 'admin' ? <Route path = "/Categories" exact component = {Categories}/> : <Link to = "/"></Link> }
                {user?.result?.userRole === 'admin' ? <Route path = "/SubCategories" exact component = {SubCategories}/> : <Link to = "/"></Link> }
                {user?.result?.userRole === 'admin' ? <Route path = "/Advisors" exact component = {Advisors}/> : <Link to = "/"></Link> }
                {user?.result?.userRole === 'admin' ? <Route path = "/Users" exact component = {Users}/> : <Link to = "/"></Link> }
                <Route path = "/Blogs" exact component         = {Blogs} />
                <Route path = "/PaymentMethod" exact component = {PaymentMethod} />
                <Route path = "/Account" exact component       = {Account} />
                <Route path = "/Auth" exact component          = {Auth} />
                {/* <Route path = "/Streamer" exact component      = {() => <Streamer />} /> */}
              </Switch>
          
            </div>
          <Footer />
          user?.result?.userRole

        </BrowserRouter>
      </div>
  )
}

export default App;
